import Head from "next/head";

const MyHead = props => {
  console.log(`Head Props: ${props}`);
  return (
    <Head>
      <title>{props.page} // Ryan Grunest</title>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
    </Head>
  );
};

export default MyHead;
